import axios from "axios";
import { BaseURL } from "../constants/BaseURL";

export const findContestResults = (id: string): Promise<void> => {
  return axios
    .get(`${BaseURL}/concursos/${id}`)
    .then((res) => {
      return res.data;
    })
    .catch((err) => {
      console.log(err.response);
    });
};
